                                                    <p class=""time"">
                                                        26 March 2017 by <a href=""#""> juliawest</a>
                                                    </p>
                                                </div>
                                            </div>
                                            <p>If there were not an audience for Marvel comic heroes than clearly these films would not be made, to answer one other reviewer although I sympathize with him somewhat. The world is indeed an infinitely more complex place than the world of Marvel comics with clearly identifiable heroes and villains. But I get the feeling that from Robert Downey, Jr. on down the organizer and prime mover as Iron Man behind the Avengers these players do love doing these roles because it");
            WriteLiteral(@"'s a lot of fun. If they didn't show that spirit of fun to the audience than these films would never be made.</p>

                                            <p>So in that spirit of fun Avengers: Age Of Ultron comes before us and everyone looks like they're having a good time saving the world. A computer program got loose and took form in this dimension named Ultron and James Spader who is completely unrecognizable is running amuck in the earth. No doubt Star Trek fans took notice that this guy's mission is to cleanse the earth much like that old earth probe NOMAD which got its programming mixed up in that classic Star Trek prime story. Wouldst Captain James T. Kirk of the Enterprise had a crew like Downey has at his command.</p>
                                            <p>My favorite is always Chris Evans because of the whole cast he best gets into the spirit of being a superhero. Of all of them, he's already played two superheroes, Captain America and Johnny Storm the Human Torch. I'll be before he's");
            WriteLiteral(@" done Evans will play a couple of more as long as the money's good and he enjoys it.</p>

                                            <p>Pretend you're a kid again and enjoy, don't take it so seriously.</p>
                                        </div>
